import './App.css';
import ToDoList from './component/ToDoList/ToDoList';
import { Button } from '@material-ui/core'
function App() {
  function itemClick(item) {
    item.active = true;
    console.log(item);
  }
  const listToDo = [{ id: 1, title: "Title 1", active: false }, { id: 2, title: "Title 2", active: false }, { id: 3, title: "Title 3", active: false }];
  return (
    <div className="App">
      <ToDoList clickToItem={itemClick} listToDo={listToDo}></ToDoList>
      <Button variant="contained" color="primary">
        Primary
      </Button>
    </div>
  );
}

export default App;
